export default function Card({ word }) {
  return (
    <main>
      <div className="word"><div>{word}</div></div>
      <style jsx>{`
        main {
          display: flex;
          flex-basis: 20%;
          text-align: center;
          align-content: center;
          justify-content: center;
          background: lightblue;
          width: 100%;
          margin: 0 4px;
        }
        .word {
          display: flex;
          align-content: center;
          justify-content: center;
        }
        .author {
          font-family: sans-serif;
          color: #559834;
          font-size: 20px;
        }
      `}</style>
    </main>
  )
}
